Writer:  Paul Levitz and Keith Giffen
Penciller:  Keith Giffen
Inker:  Larry Mahlstedt
Letterer:  John Costanza
Colorist:  Carl Gafford
Editor:  Karen Berger

While the majority of the Legion of Super-Heroes travel to Orando to celebrate the marriage of Karate Kid and Queen Projectra, Bouncing Boy and Duo Damsel stay behind on monitor duty. One squad of Legionnaires who went to Weber's World to investigate it are caught by the Emerald Empress and Ontiir, a Science Police officer who secretly worked for the Dark Circle. The Legion are able to free themselves and defeat Emerald Empress and Ontiir.

Thanks goes to DobisP.R. for this release.

